import React from 'react';
import { PlusGrid, PlusGridItem, Text } from '@app/components';
import { Utils } from '@app/utils';

export const Banner = () => {

  const classes = Utils.classes(
    'banner'
  );

  return (
    <div className={classes}>
      <PlusGrid gutter="md">
        <PlusGridItem>
          <Text>
            Betisa
          </Text>
        </PlusGridItem>
        <PlusGridItem xs="grow" />
        <PlusGridItem>
          <Text size="label">
            See how HTML+ fits into the entire Betisa Ecosystem -&gt;
          </Text>
        </PlusGridItem>
        <PlusGridItem hide-xs>
          <Text>
            |
          </Text>
        </PlusGridItem>
        <PlusGridItem>
          <Text>
            BLACK LIVES MATTER
          </Text>
        </PlusGridItem>
      </PlusGrid>
    </div>
  );
};
